import React from 'react'

const MoviesLists = (props) => {
  return (
<>
    <h1 style={{color: 'black'}}>Top Movies</h1>
    <img src={props.img} alt= "movies-img" />
    <p>Movie: {props.title}</p>
    <p>Year: {props.year}</p>
    <p>Runtime: {props.runtime}</p>

    </>
  )
}

export default MoviesLists
